var deltaZeit, deltaWert, value, oldValue, verbrauchInKubikmeter, verbrauchInKwh, gasVolumenStrom, leistung;


on({id: 'mqtt.0.SmartHome.Sensor.Haustechnikraum.Impulszaehler.Zaehler_0.Impulse', change: "any"}, function (obj) {
  var value = obj.state.val;
  var oldValue = obj.oldState.val;
  // Zeitdifferenz seit letzter Änderung in ms
  deltaZeit = (new Date().getTime()) - getState("javascript.0.Gas.Verbrauch_Volumen").lc;
  // Anzahl Impulse seit letzter Änderung
  deltaWert = value - oldValue;
  if (deltaWert > 0) {
    // Wenn Zähler läuft
    if (!getState("javascript.0.Gas.BrennerAktiv").val) {
      setState("javascript.0.Gas.BrennerAktiv"/*BrennerAktiv*/, true, true);
      setState("javascript.0.Gas.Brennerstarts"/*Brennerstarts*/, (getState("javascript.0.Gas.Brennerstarts").val + 1), true);
    }
    // Verbrauch in m³
    verbrauchInKubikmeter = Math.round((getState("javascript.0.Gas.Verbrauch_Volumen").val + deltaWert * 0.01)*100)/100;
    setState("javascript.0.Gas.Verbrauch_Volumen"/*Verbrauch Volumen*/, verbrauchInKubikmeter, true);
    // Verbrauch in kwh
    verbrauchInKwh = Math.round((verbrauchInKubikmeter * getState("javascript.0.Gas.Brennwert").val * getState("javascript.0.Gas.Zustandszahl").val)*100)/100;
    setState("javascript.0.Gas.Verbrauch_Energie"/*Verbrauch Energie*/, verbrauchInKwh, true);
    // gasVolumenStrom in m³/s
    gasVolumenStrom = (deltaWert * 0.01) / (deltaZeit / 1000);
    // leistung in W
    leistung = Math.round(gasVolumenStrom * getState("javascript.0.Gas.Brennwert").val * getState("javascript.0.Gas.Zustandszahl").val * 3600000);
    setState("javascript.0.Gas.Leistung"/*Leistung*/, leistung, true);
  } else {
    // Wenn Zähler nicht läuft
    if (getState("javascript.0.Gas.BrennerAktiv").val) {
      deltaZeit = (new Date().getTime()) - getState("javascript.0.Gas.BrennerAktiv").lc;
      setState("javascript.0.Gas.BrennerAktiv"/*BrennerAktiv*/, false, true);
      setState("javascript.0.Gas.Leistung"/*Leistung*/, 0, true);
      setState("javascript.0.Gas.Brennerlaufzeit"/*Brennerlaufzeit*/, (Math.round(getState("javascript.0.Gas.Brennerlaufzeit").val + deltaZeit / 1000)), true);
    }
  }
});

